class MyPage extends React.Component {

  constructor(props) {
    super(props);

    this.state = { 
      uglyId: '',
      response: ''
    };
    this.state = { 
      codeSystem: '',
      response: ''
    };

  }

  /* componentDidMount() {
    fetch('https://api.helsedirektoratet.no/innhold/innhold?q=react')
